    useEffect(() => {
        fetch("/api/data")
          .then((response) => response.json())
          .then((data) => {
            console.log(data);
            setBackendData(data);
          })
          .catch((error) => {
            console.error(error);
          });
      }, []);
    return(
        <div className="App">
          
        </div>
    );
}
export default Book;
